CREATE DATABASE `dbpersonal` /*!40100 DEFAULT CHARACTER SET latin1 */;


use dbpersonal;

CREATE TABLE `tb_usuarios` (
  `int_id_usuario` int(11) NOT NULL AUTO_INCREMENT,
  `vchar_nombre` varchar(45) DEFAULT NULL,
  `vchar_apellido` varchar(45) DEFAULT NULL,
  `vchar_telefono` varchar(10) DEFAULT NULL,
  `int_edad` int(11) DEFAULT NULL,
  `date_fecha_ingreso` datetime DEFAULT NULL,
  `vchar_foto` longtext,
  PRIMARY KEY (`int_id_usuario`)
) ENGINE=MyISAM AUTO_INCREMENT=1 DEFAULT CHARSET=latin1;

